script: |
  super -f text -I q5630.spq | sort > q5630.out

inputs:
  - name: q5630.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + + 63 NOT BETWEEN col1 - + - 41 AND - CAST ( - CAST ( NULL AS INTEGER ) AS REAL ) - ( - 62 ) - - col1;
  - name: tab1

outputs:
  - name: q5630.out
    data: |
      91	47	68
